import React, { Component } from 'react'

export class MealPlanResults extends Component {
    render() {
        

        return (
            <>
                { this.props.meals.map(meal => 
                    <div className="MealResultContainer" key={meal.id}>
                        {meal.image}
                        {meal.title}
                    </div>
                ) }
            </>
        )
    }
}

export default MealPlanResults
